import {StyleSheet} from "react-native"

export default StyleSheet.create({
    body: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: "space-evenly",
        flexDirection: "column",
      },
      image:{
        width: 190,
        height: 150,
        marginTop: "10%"
      },
      fotoText:{
        backgroundColor: "#C4C4C4",
        borderRadius: 60,
        width: "30%",
        height: "80%",
        alignItems: "center",
        justifyContent: "center"
      },
      textInfo:{
        fontSize: 18
      },
      info: {
        width: "80%",
        height: 40,
        flexDirection: "row",
        justifyContent: "space-between",
        borderBottomWidth: 2,
        borderBottomColor: "black",
        padding: 5,
        alignSelf: "center",
        margin: "3%"
      },
      scrollView: {
        width: "100%",
        height: "55%",
        marginHorizontal: 20,
      },
      title:{
        alignSelf: "center",
        fontSize: 20,
        fontWeight: "bold",
      }
})
